import Navbar from '../components/Navbar';
import Footer from '../components/Footer';

const Page = ({children}) => {
    return (
        <>
            <Navbar />
            <div className="w-full lg:pt-14 bg-slate-100 min-h-screen">
                {children}
                <Footer />
            </div>
        </>
    );
}

export default Page;
